import React from "react";
import classes from "./categoryBody.module.scss";
import FiltersSidebar from "../filtersSidebar/FiltersSidebar";

const CategoryBody = () => {
  return (
    <div className={classes.categoryBody}>
      <FiltersSidebar />
    </div>
  );
};

export default CategoryBody;
